def minimum_sweets_to_carry(n, t, street):

    def check(casas):
        current = casas
        time = t
        need = 0
        last_house = 0
        for (ind, i) in enumerate(street):
            time -= 1
            if i == 'S':
                current += 1
            elif i == 'H':
                need += 1
                if need == 1:
                    last_house = ind
            if need > 0 and current >= need:
                current -= need
                casas -= need
                need = 0
                if casas > 0:
                    if (ind - last_house) * 2 >= n - last_house - 1:
                        time -= n - last_house - -1 + n - ind - 1
                        return time >= 0
                    time -= (ind - last_house) * 2
                else:
                    time -= ind - last_house
            if casas == 0:
                break
        return time >= 0 and casas == 0
    street = street.rstrip('.')
    n = len(street)
    C = street.count('H')
    S = street.count('S')
    l = max(C - S, 0)
    r = 500005
